  `detail_show` int NOT NULL DEFAULT '0' COMMENT '详情显示 #0：显示 ,1：不显示',
  `is_excel` int NOT NULL DEFAULT '0' COMMENT '是否需要导入导出 #0：需要 ,1：不需要',
