  `opt_element` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT 'input' COMMENT '操作组件 #input：文本框，textarea：文本域，select：下拉框，radio：单选框，checkbox：多选框，timepicker：时间选择器，datapicker：日期选择器，datetimepicker：日期时间选择器',
  `dict_domain_code` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '字典域编码',
  `create_by` bigint NOT NULL COMMENT '创建者',
  `create_username` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '创建者账号',
  `create_time` bigint NOT NULL COMMENT '创建时间',
  `update_by` bigint DEFAULT NULL COMMENT '更新者',
  `update_username` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '更新者账号',
  `update_time` bigint DEFAULT NULL COMMENT '更新时间',
  `is_del` int NOT NULL DEFAULT '0' COMMENT '逻辑删除状态 0：未删除 1：已删除',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT='代码生成列配置';

