-- ----------------------------
-- Table structure for generate_config
-- ----------------------------
DROP TABLE IF EXISTS `generate_config`;
CREATE TABLE `generate_config` (
  `id` bigint NOT NULL COMMENT '主键ID',
  `type` int NOT NULL DEFAULT '2' COMMENT '配置类型 #1：全局配置, 2：表配置',
  `table_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '表名称',
  `module_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '后端模块名称',
  `ui_module_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '前端模块名称',
  `table_remarks` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '表描述',
  `package_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '包名',
  `request_mapping_prefix` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'RequestMapping 路径前缀\n',
  `parent_menu_id` bigint DEFAULT NULL COMMENT '所属菜单',
  `output_path` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '生成代码路径',
  `is_open` int NOT NULL DEFAULT '0' COMMENT '生成完代码后是否打开目录  #0：打开，1：不打开',
  `author` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL DEFAULT 'zoe' COMMENT '作者',
  `col_span` int NOT NULL DEFAULT '24' COMMENT '表单中占用栅格的列数',
  `enable_cache` int NOT NULL DEFAULT '1' COMMENT '开启路由缓存 #0：开启，1：不开启',
  `enable_import` int NOT NULL DEFAULT '0' COMMENT '生成导入 #0：生成，1：不生成',
  `enable_export` int NOT NULL DEFAULT '0' COMMENT '生成导出 #0：生成 ,1：不生成',
  `enable_log` int NOT NULL DEFAULT '0' COMMENT '生成log注解 #0：生成 ，1：不生成',
  `enable_builder` int NOT NULL DEFAULT '0' COMMENT '开启Builder模式 #0：开启 ，1：不开启',
  `template_json` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '生成模板json配置',
  `exclude_table_prefix` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '过滤表前缀 多个用,分隔',
  `exclude_table_suffix` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '过滤表后缀 多个用,分隔',
  `exclude_field` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '过滤实体类属性 多个用,分隔',
  `remarks` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '备注',
  `create_by` bigint NOT NULL COMMENT '创建者',
  `create_username` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '创建者账号',
  `create_time` bigint NOT NULL COMMENT '创建时间',
  `update_by` bigint DEFAULT NULL COMMENT '更新者',
  `update_username` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '更新者账号',
  `update_time` bigint DEFAULT NULL COMMENT '更新时间',
  `is_del` int NOT NULL DEFAULT '0' COMMENT '逻辑删除状态 0：未删除 1：已删除',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT='代码生成参数配置';

